import { Routes, Route } from "react-router-dom";
import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import Home from "./Components/"


function App() {
  return (
      <div className="App">
          <Navbar/>
          <Routes>
            <Route path="/" element={<App/>}>
              <Route path="/home" element={<Home/>}></Route>
            </Route>
          </Routes>
          <Footer/>
      </div>
  );
}

export default App;
